import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar2 from '../Layout/Navbar2';
import { Link, useParams } from "react-router-dom";
import { Button } from 'react-bootstrap'
import { useState, useEffect } from "react";
import axios from 'axios';


function AddEmployee(props) {
  const [employees, setEmployees] = useState([]);
  const { id } = useParams();
  useEffect(() => {
    loadEmployees();
  }, []);

  const loadEmployees = async () => {
    const result = await axios.get('http://localhost:8080/admin/employee/getemployees');
    console.log(result.data);
    setEmployees(result.data);
  }





  return (
    <div>
      <Navbar2></Navbar2>
      <br></br>
      <div className="container">
        <div className="row">
          <div className="col-md-4 offset-md-4 border rounded  mt-2 shadow">
            <form >
              <div className="mb-10">
                <br></br>
                <Link to="/employeeform"> <Button style={{ marginRight: '50px', backgroundColor: 'rgb(96, 197, 228' }}>AddEmployee</Button></Link>
                <Link to="/managerform"><Button style={{ backgroundColor: 'rgb(96, 197, 228' }}>Add Manager</Button></Link>
              </div>
              <br></br>
            </form>
          </div>

        </div>
      </div>



      <div className="container">
        <div className="py-4">
          <table className="table table-striped table-hover " >
            <thead>
              <tr>
                <th scope="col">Id</th>
                <th scope="col">FirstName</th>
                <th scope="col">LastName</th>
                <th scope="col">Email</th>
                <th scope="col">Manager</th>
                <th scope="col">Action</th>
              </tr>
            </thead>
            <tbody class="table-group-divider">
              {
                employees.map((employees, index) => (
                  <tr>
                    {/* <th scope="row" key={index}> {index + 1} </th> */}
                    <td>{employees.employeeId}</td>
                    <td>{employees.firstName}</td>
                    <td>{employees.lastName}</td>
                    <td>{employees.emailId}</td>
                    <td>{employees.memailId}</td>
                    <td>
                      {/* <Link to={`/assignmanager`} className="btn btn-primary " data-bs-toggle="modal" data-bs-target="#exampleModal">View</Link> */}
                      {/* <Link   to={`/editemployee/${employees.id}`}className="btn btn-light mx-2"  >Edit</Link>
                                    <button type="button" className="btn btn-danger mx-2"
                                    onClick={()=>assignManager(employees.EmployeeId,employees.ManagerId)}>Delete</button> */}
                      <button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target="#exampleModal">
                        Assign
                      </button>
                    </td>

                  </tr>
                ))
              }
            </tbody>
          </table>
        </div>
      </div>




      <div className="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h1 className="modal-title fs-5" id="exampleModalLabel">Modal title</h1>
              <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
            </div>
            <div className="modal-body">
              <h2>Hi</h2>
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Close</button>
              <button type="button" className="btn btn-primary">Save changes</button>
            </div>
          </div>
        </div>
      </div>

















    </div>
  );
}

export default AddEmployee;
